mapper.select:

select 

from FCRMIN
where FCRMIN_TXDATE = #{fcrminTxdate,jdbcType=CHAR}
  and FCRMIN_BRNO = #{fcrminBrno,jdbcType=CHAR}
  and FCRMIN_FEPNO = #{fcrminFepno,jdbcType=CHAR}

mapper.delete:

delete from FCRMIN
where FCRMIN_TXDATE = #{fcrminTxdate,jdbcType=CHAR}
  and FCRMIN_BRNO = #{fcrminBrno,jdbcType=CHAR}
  and FCRMIN_FEPNO = #{fcrminFepno,jdbcType=CHAR}
